css:
atom-text-editor {
  background-color: #fdfdfd;
  color: #181818;
}
atom-text-editor .gutter:last-child {
  background-color: #f8f8f8;
  color: #181818;
  margin-right: 5px;
}
atom-text-editor .gutter .line-number.cursor-line {
  background-color: #e8e8e8;
  color: #181818;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection {
  color: #181818;
}
atom-text-editor .wrap-guide {
  color: #e8e8e8;
}
atom-text-editor .indent-guide {
  color: #e8e8e8;
}
atom-text-editor .invisible-character {
  color: #e0e0e0;
}
atom-text-editor .search-results .syntax--marker .region {
  background-color: transparent;
  border: rgba(243, 255, 181, 0.1);
}
atom-text-editor .search-results .syntax--marker.current-result .region {
  border: #181818;
}
atom-text-editor.is-focused .cursor {
  border-color: #181818;
}
atom-text-editor.is-focused .selection .region {
  background-color: rgba(98, 149, 165, 0.15);
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line {
  background-color: rgba(255, 255, 255, 0.05);
}
.syntax--comment {
  background-color: #dbf3cd;
  color: #22a21f;
  opacity: 0.8;
}
.syntax--constant {
  color: #1586d2;
}
.syntax--entity {
  color: #181818;
}
.syntax--keyword {
  color: #fb6620;
}
.syntax--storage {
  color: #fc1785;
}
.syntax--string {
  color: #1586d2;
}
.syntax--support {
  color: #e20072;
}
.syntax--variable {
  color: #fc1785;
}
.syntax--invalid {
  background-color: #d40915;
  color: #f8f8f8;
  opacity: 0.8;
}
.syntax--entity.syntax--name.syntax--tag {
  color: #f92672;
}
.syntax--entity.syntax--other.syntax--attribute-name {
  color: #a6e22e;
}
